  \"2013-03-15T22:59:30.603210\",\n\t\"name\": \"gravity-data-in-the-southeastern-united-states-1978\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Progress report using gravity data to predict
  locations and approximate sizes of granitic plutons beneath the Atlantic Coastal
  Plain. Constain and Perry report a new heat flow value from the Petersburg granite
  of 1.24 x 10-6 cal/cm2-sec. This value lies above that predicted by the linear relation
  as do the Rolesville 2 and Castalia values. The interpretation of the linear hear
  production-heat flow relation continues to receive close attention. In this resort,
  the points lying above the line are interpreted as resulting from  increased thickness
  of the granite layer.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
